import React, { useState } from 'react';

function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState(null);
  const [error, setError] = useState(null);

  const exampleQueries = [
    'Show me all diabetic patients over 50',
    'Find female patients with hypertension',
    'List patients under 30 with depression',
    'Show male patients with heart disease over 65',
    'Get all active asthma patients',
  ];

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    try {
      const res = await fetch('http://localhost:5050/api/query', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ query }),
      });

      if (!res.ok) throw new Error('Backend error');
      const data = await res.json();
      setResults(data);
    } catch (err) {
      console.error('Failed to fetch data:', err);
      setError('Failed to fetch data. Please check if backend is running and CORS is enabled.');
    }
  };

  const renderPatientStats = () => {
    const entries = results?.fhir_response?.entry;
    if (!entries || !Array.isArray(entries)) return <p>No patient data available.</p>;

    const genderCounts = { Male: 0, Female: 0 };
    const ageGroups = { '<40': 0, '40–59': 0, '60+': 0 };

    for (const entry of entries) {
      const patient = entry.resource;
      const gender = patient.gender;
      const age = patient.age;

      if (gender === 'male') genderCounts.Male++;
      if (gender === 'female') genderCounts.Female++;

      if (age < 40) ageGroups['<40']++;
      else if (age < 60) ageGroups['40–59']++;
      else ageGroups['60+']++;
    }

    return (
      <div>
        <h3>📊 Patient Stats</h3>
        <ul>
          <li><strong>Total Patients:</strong> {entries.length}</li>
          <li><strong>Male:</strong> {genderCounts.Male}</li>
          <li><strong>Female:</strong> {genderCounts.Female}</li>
        </ul>
        <h4>Age Distribution:</h4>
        <ul>
          <li>&lt; 40: {ageGroups['<40']}</li>
          <li>40–59: {ageGroups['40–59']}</li>
          <li>60+: {ageGroups['60+']}</li>
        </ul>
      </div>
    );
  };

  return (
    <div style={{ padding: '2rem', fontFamily: 'Arial' }}>
      <h2>🧠 AI-Powered FHIR Query Interface</h2>
      <p>Ask questions about patient data in natural language.</p>

      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={query}
          placeholder="Show me all diabetic patients over 50"
          onChange={(e) => setQuery(e.target.value)}
          style={{ width: '400px', padding: '8px' }}
        />
        <button type="submit" style={{ marginLeft: '10px', padding: '8px 16px' }}>Search</button>
      </form>

      <div style={{ marginTop: '1rem' }}>
        <strong>Try these examples:</strong>
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '10px', marginTop: '0.5rem' }}>
          {exampleQueries.map((ex, i) => (
            <button key={i} onClick={() => setQuery(ex)}>{ex}</button>
          ))}
        </div>
      </div>

      {error && <p style={{ color: 'red' }}>{error}</p>}

      <div style={{ marginTop: '2rem' }}>
        {results && (
          <>
            <h3>📝 FHIR Query</h3>
            <pre>{JSON.stringify(results.fhir_query, null, 2)}</pre>

            {renderPatientStats()}
          </>
        )}
      </div>
    </div>
  );
}

export default App;
